                ["preferToUpdate"] = true,
                ["customText"] = "function()\
       if WeakAuras.IsOptionsOpen() then\
           local highest = math.random(300, 700)\
           local myhp = 500\
           local max = 1000\
           local diffperc = Round(((highest-myhp)*1000)/max)/10\
           if diffperc < 0 then diffperc = diffperc*-1 end\
           if diffperc <= 5 then -- Green\
               aura_env.region:Color(0, 1, 0, 1)                \
           elseif diffperc <= 10 then -- Yellow\
               aura_env.region:Color(1, 1, 0.25, 1)                \
           elseif diffperc <= 15 then -- Orange\
               aura_env.region:Color(1, 0.62, 0.25, 1)                \
           elseif diffperc <= 20 then -- More Orange\
               aura_env.region:Color(1, 0.37, 0.25, 1)                \
           else -- Red                \
               aura_env.region:Color(1, 0.25, 0.25, 1)\
           end\
           if highest >= myhp then -- other collectors have more hp than the one the player is targeting\
               local diff = highest-myhp\
               local perc = Round((diff*100)/max)\
               return \"+\"..perc..\"%\"\
           else -- our collector has the highest hp            \
               local diff = myhp-highest -- if our collector has the highest hp we compare to the 2nd highest which will still be stored in this variable\
               local perc = Round((diff*100)/max)\
               return \"-\"..perc..\"%\"\
           end\
       elseif aura_env.state and aura_env.state.health then\
           local highest = 0\
           local myhp = aura_env.state.health\
           local total = 0\
           local totalcount = 0\
           local bypass = false\
           for i=1, 10 do\
               local u = \"boss\"..i\
               if UnitExists(u) and select(6, strsplit(\"-\", UnitGUID(u))) == \"242587\" then\
                   local hp = UnitHealth(u)\
                   if hp == 1 or hp == 0 then bypass = true break end -- adds maybe stay at 1/0 hp but a valid unit id so once the first one dies, everyone gets a green light\
                   total = hp and total+hp or total\
                   totalcount = hp and totalcount+1 or totalcount\
                   if not UnitIsUnit(aura_env.state.unit, u) then\
                       highest = math.max(highest, hp)\
                   end\
               end\
           end    \
           if bypass then\
               aura_env.region:Color(0, 1, 0, 1)\
               return \"KILL\"\
           end\
           if totalcount >= 1 then\
               local average = total/totalcount\
               local diffperc = Round(((average-myhp)*1000)/aura_env.state.maxhealth)/10\
               if diffperc <= 5 then -- Green\
                   aura_env.region:Color(0, 1, 0, 1)                \
               elseif diffperc <= 10 then -- Yellow\
                   aura_env.region:Color(1, 1, 0.25, 1)                \
               elseif diffperc <= 15 then -- Orange\
                   aura_env.region:Color(1, 0.62, 0.25, 1)                \
               elseif diffperc <= 20 then -- More Orange\
                   aura_env.region:Color(1, 0.37, 0.25, 1)                \
               else -- Red                \
                   aura_env.region:Color(1, 0.25, 0.25, 1)\
               end\
               if average >= myhp then -- other adds have more hp than the current one\
                   local diff = average-myhp\
                   local perc = Round((diff*100)/aura_env.state.maxhealth)\
                   return \"-\"..perc..\"%\"\
               else -- our collector has the highest hp            \
                   local diff = myhp-average -- if the current add has the highest hp we compare to the 2nd highest which will still be stored in this variable\
                   local perc = Round((diff*100)/aura_env.state.maxhealth)\
                   return \"+\"..perc..\"%\"\
               end\
           end\
       end\
   end\
